import React from "react";
import "../styles.css";
import { Link } from "react-router-dom";

function Login() {
  return (
    <div>
      <h1 style={{ color: "#004cff", fontSize: "100px" }}>인뱅</h1>
      <h2 style={{ color: "#004cff" }}>In-Bang</h2>
      <p style={{ color: "#004cff" }}>
        <br />
        Are you ready to watch exciting movies? Click the box below to get you
        started!
      </p>

      <div
        style={{
          backgroundColor: "#1200b8",
          padding: "20px",
          color: "white",
          width: "200px",
          margin: "auto",
        }}
      >
        <label>
          Username:
          <input type="text" name="username" />
        </label>
        <br />
        <label>
          Password:
          <input type="password" name="password" />
        </label>
        <br />
        <button>Login</button>
        <button>Register</button>
      </div>

      <Link to="/login">
        <button
          style={{
            backgroundColor: "#1200b8",
            color: "white",
            padding: "5px",
          }}
        >
          Get Started >
        </button>
      </Link>
    </div>
  );
}

export default Login;
